;\n            &lt;/div&gt;\n            "},"id":"1175","type":"HoverTool"},{"attributes":{"child":{"id":"bk-bandwidth-type-plot"},"title":"Bandwidth (Types)"},"id":"1216","type":"Panel"},{"attributes":{"dimensions":"width"},"id":"1092","type":"WheelZoomTool"},{"attributes":{"formatter":{"id":"1255"},"major_label_orientation":-0.2617993877991494,"major_label_policy":{"id":"1257"},"ticker":{"id":"1160"}},"id":"1159","type":"CategoricalAxis"},{"attributes":{},"id":"1137","type":"ResetTool"},{"attributes":{"source":{"id":"1177"}},"id":"1201","type":"CDSView"},{"attributes":{},"id":"1260","type":"AllLabels"},{"attributes":{"text":"Bandwidth by Worker"},"id":"1149","type":"Title"},{"attributes":{"text":"\n        &lt;h1&gt; Dask Performance Report &lt;/h1&gt;\n\n        &lt;i&gt; Select different tabs on the top for additional information &lt;/i&gt;\n\n        &lt;h2&gt; Duration: 5.69 s &lt;/h2&gt;\n        &lt;h2&gt; Tasks Information &lt;/h2&gt;\n        &lt;ul&gt;\n         &lt;li&gt; number of tasks: 14410 &lt;/li&gt;\n         \n&lt;li&gt; compute time: 5.28 s &lt;/li&gt;\n&lt;li&gt; disk-read time: 78.10 ms &lt;/li&gt;\n&lt;li&gt; transfer time: 1.22 s &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Scheduler Information &lt;/h2&gt;\n        &lt;ul&gt;\n          &lt;li&gt; Address: tcp://127.0.0.1:36573 &lt;/li&gt;\n          &lt;li&gt; Workers: 10 &lt;/li&gt;\n          &lt;li&gt; Threads: 10 &lt;/li&gt;\n          &lt;li&gt; Memory: 503.79 GiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2021.04.0+3.gc5633c21 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 2021.04.0 &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\ndef main():\n    client = Client(n_workers=10, threads_per_worker=1)\n    print(client)\n\n    df = dask.datasets.timeseries(\n        start=\"2000-01-01\",\n        end=\"2000-01-31\",\n        # end=\"2000-12-31\",\n        partition_freq=\"1h\",\n        freq=\"60s\",\n    )\n    df = df.persist()\n    wait(df)\n    iterations = 10\n\n    with performance_report(filename=f\"{today}-simple-scheduler.html\"):\n        simple = []\n        # print('start simple: ', flush=True)\n        for i in range(iterations):\n            start = time.monotonic()\n            z = df.x + 1 + 2 - df.y\n            z.sum().compute()\n            stop = time.monotonic()\n            simple.append(stop - start)\n        simple = np.array(simple)\n\n    df2 = None\n    with performance_report(filename=f\"{today}-shuffle-scheduler.html\"):\n        shuffle_t = []\n        # print('start shuffle: ', flush=True)\n        for i in range(iterations):\n            client.cancel(df2)\n            start = time.monotonic()\n            # shuffle(df, \"id\", shuffle=\"tasks\")\n            df2 = df.set_index(\"id\").persist()\n            wait(df2)\n            stop = time.monotonic()\n            shuffle_t.append(stop - start)\n        shuffle_t = np.array(shuffle_t)\n\n    with performance_report(filename=f\"{today}-rand-access-scheduler.html\"):\n        rand_access = []\n        for i in range(iterations):\n            start = time.monotonic()\n            df2.head()\n            stop = time.monotonic()\n            rand_access.append(stop - start)\n        rand_access = np.array(rand_access)\n    data = dsa.random.random((10000, 1000000), chunks=(1, 1000000))\n    da = xr.DataArray(data, dims=['time', 'x'],\n                      coords={'day': ('time', np.arange(10000) % 100)})\n    clim = da.groupby('day').mean(dim='time')\n    anom = da.groupby('day') - clim\n    anom_mean = anom.mean(dim='time')\n    with performance_report(filename=f\"{today}-anom-mean-scheduler.html\"):\n        anom_mean_t = []\n        for i in range(iterations):\n            start = time.monotonic()\n            anom_mean.compute()\n            stop = time.monotonic()\n            anom_mean_t.append(stop-start)\n\n        anom_mean_t = np.array(anom_mean_t)\n\n    return dict(simple=simple, shuffle=shuffle_t, rand_access=rand_access,\n            anom_mean=anom_mean_t)\n\n        &lt;/pre&gt;\n        "},"id":"1209","type":"Div"},{"attributes":{},"id":"1288","type":"Selection"},{"attributes":{},"id":"1222","type":"Title"},{"attributes":{"callback":null},"id":"1090","type":"TapTool"},{"attributes":{},"id":"1194","type":"CategoricalTicker"},{"attributes":{"factors":[]},"id":"1183","type":"FactorRange"},{"attributes":{"base":1024,"mantissas":[1,2,4,8,16,32,64,128,256,512]},"id":"1204","type":"AdaptiveTicker"},{"attributes":{},"id":"1281","type":"Selection"}],"root_ids":["1217"]},"title":"Bokeh Application","version":"2.3.0"}}
